    "tt9207616": { infoHash: "815a25060b1ff03df4630596f46b9d9c7e6e5d05", type: "movie", title: "PelicuLatino", name: "El mensajero", genres: ['Acción', 'Crimen', 'Drama'], imdbRating: "5.0/10", releaseInfo: "2019", director: ['Zackary Adler'], cast: ['Olga Kurylenko', 'Gary Oldman', 'Amit Shah', 'Alicia Agneson', 'Greg Orvis', 'Craig Conway', 'William Moseley', 'Dermot Mulroney', 'Calli Taylor', 'Lee Charles', 'Gordon Alexander'], description: "Una mensajera en Londres descubre que uno de los paquetes que está transportando es una bomba, lo cual pone en peligro la tarea de los federales de proteger a un hombre que debe testificar contra un poderoso criminal." },
