    "tt10151054": { infoHash: "1cd0b3eb1e53acd48303f81ba04b3a4e93bd6325", type: "movie", title: "PelicuLatino", name: "La cantera", genres: ['Crimen', 'Misterio', 'Suspenso'], imdbRating: "5.1/10", releaseInfo: "2020", director: ['Scott Teems'], cast: ['Michael Shannon', 'Shea Whigham', 'Bruno Bichir', 'Anna Watt', 'Alvaro Martinez', 'Catalina Sandino Moreno', 'Abel Becerra', 'Jimmy Gonzales', 'Bobby Soto', 'Rose Bianco'], description: "Después de asesinar a un predicador itinerante, un fugitivo viaja a un pequeño pueblo y se hace pasar por el hombre que mató. Aunque la congregación gusta de los sermones de perdón, el jefe de policía local sospecha del hombre." },
    "tt9850064": { infoHash: "8dad808db6abfe78410aa31b63f7c16ca95bbcbf", type: "movie", title: "PelicuLatino", name: "Espíritus del mar", genres: ['Animación', 'Aventura', 'Drama'], imdbRating: "6.5/10", releaseInfo: "2019", director: ['Ayumu Watanabe'], cast: ['Mana Ashida', 'Hiiro Ishibashi', 'Seishû Uragami', 'Win Morisaki', 'Yû Aoi', 'Sumiko Fuji', 'Gorô Inagaki', 'Sanurzhan Suleimen', 'Min Tanaka', 'Tôru Watanabe'], description: "Ruka es una joven cuyo padre trabaja en un acuario, y ella se siente atraída hacia un misterio que tiene que ver con la vida marina alrededor del mundo, en el cual dos jóvenes están involucrados." },
    "tt9086228": { infoHash: "56383d3d5909d199876430a1a4e2611d659c4d07", type: "movie", title: "PelicuLatino", name: "Gretel & Hansel: Un siniestro cuento de hadas", genres: ['Fantasía', 'Terror', 'Suspenso'], imdbRating: "5.3/10", releaseInfo: "2020", director: ['Oz Perkins'], cast: ['Sophia Lillis', 'Samuel Leakey', 'Alice Krige', 'Jessica De Gouw', 'Fiona OShaughnessy', 'Donncha Crowley', 'Jonathan Gunning', 'Charles Babalola', 'Giulia Doherty'], description: "Hace mucho tiempo en el distante bosque de un cuento de hadas, una joven lleva a su hermano menor en una desesperada búsqueda de comida y trabajo, solo para encontrarse con un sitio de aterradora maldad." },
