    "tt9580138": { infoHash: "9ca58a328c290f051bd86cd56ce4ed5f57aa474b", type: "movie", title: "PelicuLatino", name: "Mortal Kombat Legends: La venganza de Scorpion", genres: ['Animación', 'Acción', 'Aventura'], imdbRating: "7.6/10", releaseInfo: "2020", director: ['Ethan Spaulding'], cast: ['Joel McHale', 'Grey Griffin', 'Jennifer Carpenter', 'Kevin Michael Richardson', 'Steve Blum', 'Fred Tatasciore', 'Robin Atkin Downes', 'Jordan Rodrigues', 'Darin De Paul'], description: "Hanzo Hasashi pierde su clan, su familia y su vida durante un ataque por un clan ninja rival. Pero recibe la oportunidad de competir en un torneo interdimensional para salvar a sus seres queridos mientras otros luchadores intentan salvar el reino de la Tierra de la aniquilación." },
