    "tt4807408": { infoHash: "8bf3da627735e174aa88bf06eb479605c018d6ce", type: "movie", title: "PelicuLatino", name: "Los mejores amigos", genres: ['Biografía', 'Drama', 'Historia'], imdbRating: "7.1/10", releaseInfo: "2019", director: ['Robin Bissell'], cast: ['Taraji P. Henson', 'Sam Rockwell', 'Babou Ceesay', 'Anne Heche', 'Wes Bentley', 'Nick Searcy', 'Bruce McGill', 'John Gallagher Jr.', 'Nicholas Logan', 'Gilbert Glenn Brown'], description: "La activista de derechos civiles Ann Atwater se enfrenta con Paul Ellis, líder del Ku Klux Klan en Carolina del Norte en 1971, sobre el asunto de integración escolar. Basada en una historia real." },
