    "tt6193408": { infoHash: "7553e5794f4ed4566c07684788d3206ee10ff866", type: "movie", title: "PelicuLatino", name: "Shaun, el cordero - La película: Granjagedón", genres: ['Animación', 'Aventura', 'Comedia'], imdbRating: "6.9/10", releaseInfo: "2019", director: ['Will Becher', 'Richard Phelan'], cast: ['Justin Fletcher', 'John Sparkes', 'Chris Morrell', 'Andy Nyman', 'David Holt', 'Kate Harbour', 'Amalia Vitale', 'Joe Sugg', 'Emma Tate', 'Richard Webber', 'Simon Greenall'], description: "Cuando un alien con increíbles poderes cae cerca de la granja Mossy Bottom, Shaun el cordero sale en una misión de llevar al visitante intergaláctico a casa antes de que una siniestra organización pueda capturarlo." },
