    "tt4059460": { infoHash: "9812406c51609fec9e6189ff2f7bd26d116ce63a", type: "movie", title: "PelicuLatino", name: "Hard Night Falling", genres: ['Acción', 'Drama'], imdbRating: "4.4/10", releaseInfo: "2019", director: ['Giorgio Bruno'], cast: ['Dolph Lundgren', 'Hal Yamanouchi', 'Natalie Burn', 'Mario Opinato', 'Brice Martinet', 'Andrea Scarduzio', 'Chiara Arrigoni', 'Giulio Greco', 'Yoon C. Joyce'], description: "Después de una operación de la Interpol en Italia, Michael asiste a una cena de la empresa cuando hombres armados toman como rehenes a los 50 invitados y piden 150 millones de dólares." },
