    "tt7343762": { infoHash: "0d964f1f8ae0cd786196b009cbcfee0e7399974b", type: "movie", title: "PelicuLatino", name: "Chicos buenos", genres: ['Aventura', 'Comedia'], imdbRating: "6.8/10", releaseInfo: "2019", director: ['Gene Stupnitsky'], cast: ['Jacob Tremblay', 'Keith L. Williams', 'Brady Noon', 'Molly Gordon', 'Midori Francis', 'Izaac Wang', 'Millie Davis', 'Josh Caras', 'Will Forte', 'Mariessa Portelance', 'Lil Rel Howery'], description: "Tres estudiantes se escapan de la escuela y se embarcan en un épico viaje mientras llevan accidentalmente drogas robadas, son perseguidos por chicas adolescentes, y tratan de llegar a casa a tiempo para una esperada fiesta." },
