    "tt10548944": { infoHash: "2b8e1853c25c54a3403183d95f7204d08e050659", type: "movie", title: "PelicuLatino", name: "¡Jóvenes Titanes en acción! vs. Jóvenes Titanes", genres: ['Animación', 'Acción', 'Aventura'], imdbRating: "6.8/10", releaseInfo: "2019", director: ['Jeff Mednikow'], cast: ['Greg Cipes', 'Rhys Darby', 'Grey Griffin', 'Sean Maher', 'Scott Menville', 'Robert Morse', 'Khary Payton', 'Kevin Michael Richardson', 'Tara Strong', 'Hynden Walch'], description: "El quinteto cómico de la actualidad se enfrenta a sus contrapartes del 2003 cuando villanos de cada uno de sus mundos unen fuerzas para poner a los dos equipos de Titanes unos contra los otros." },
    "tt11043546": { infoHash: "1a10f4c92d15cd7556124695eb5f8aa2fc7a485b", type: "movie", title: "PelicuLatino", name: "La muerte y el regreso de Superman", genres: ['Animación', 'Acción', 'Ciencia ficción'], imdbRating: "6.3/10", releaseInfo: "2019", director: ['Jake Castorena', 'Sam Liu'], cast: ['Jerry OConnell', 'Rebecca Romijn', 'Rainn Wilson', 'Rosario Dawson', 'Nathan Fillion', 'Christopher Gorham', 'Matt Lanter', 'Shemar Moore', 'Nyambi Nyambi', 'Jason OMara'], description: "La batalla entre la Liga de la Justicia y una fuerza alienígena imparable conocida como Doomsday, una batalla que cambiará para siempre la cara de Metrópolis. Las dos películas La muerte de Superman y Reino de los supermanes ahora presentadas como una." },
    "tt8110640": { infoHash: "129005a56ca347f1c67a5e63d40d546e09c57957", type: "movie", title: "PelicuLatino", name: "Ocultos por la Luna", genres: ['Crimen', 'Misterio', 'Ciencia ficción'], imdbRating: "6.2/10", releaseInfo: "2019", director: ['Jim Mickle'], cast: ['Boyd Holbrook', 'Cleopatra Coleman', 'Michael C. Hall', 'Bokeem Woodbine', 'Rudi Dharmalingam', 'Quincy Kirkwood', 'Sarah Dugdale', 'Rachel Keller', 'Ryan Allen'], description: "Un oficial de policía que quiere convertirse en detective se obsesiona con la investigación de una asesina en serie cuyos crímenes desafían toda explicación científica." },
    "tt5092380": { infoHash: "3a33f3e587563668c070f7898474849ede06bec5", type: "movie", title: "PelicuLatino", name: "Desastre en París", genres: ['Ciencia ficción'], imdbRating: "5.9/10", releaseInfo: "2018", director: ['Daniel Roby'], cast: ['Romain Duris', 'Olga Kurylenko', 'Fantine Harduin', 'Michel Robin', 'Anna Gaylor', 'Réphaël Ghrenassia', 'Erja Malatier', 'Alexis Manenti', 'Maurice Antoni', 'Robin Barde'], description: "París es cubierta rápidamente por una misteriosa niebla que toma incontables víctimas. Los sobrevivientes deben buscar refugio en los pisos altos de los edificios y los tejados para mantenerse con vida." },
    "tt5960374": { infoHash: "fa57340722313741d64b210e3e007b3cf94b398c", type: "movie", title: "PelicuLatino", name: "Vox Lux: El precio de la fama", genres: ['Drama', 'Música'], imdbRating: "6.0/10", releaseInfo: "2018", director: ['Brady Corbet'], cast: ['Natalie Portman', 'Jude Law', 'Stacy Martin', 'Jennifer Ehle', 'Raffey Cassidy', 'Christopher Abbott', 'Logan Riley Bruner', 'Maria Dizzia', 'Meg Gibson', 'Daniel London'], description: "Después de sobrevivir una gran tragedia nacional, Celeste resurge de las cenizas y a través de una serie de circunstancias inusuales termina convirtiéndose en una estrella del pop." },
    "tt4523910": { infoHash: "f5fad76ba1074c38de4265910d68868a0d757fec", type: "movie", title: "PelicuLatino", name: "Chicuarotes", genres: ['Drama'], imdbRating: "7.1/10", releaseInfo: "2019", director: ['Gael García Bernal'], cast: ['Ricardo Abarca', 'Daniel Giménez Cacho', 'Dolores Heredia', 'Benny Emmanuel', 'Pedro Joaquín', 'Leidi Gutiérrez', 'Enoc Leaño', 'Gabriel Carbajal', 'Saúl Mercado'], description: "Un grupo de adolescentes busca desesperadamente salir de sus circunstancias opresivas, así que cuando se enteran de una oportunidad que podría cambiar sus vidas, se adentran en el oscuro mundo criminal de la Ciudad de México." },
    "tt7952000": { infoHash: "5a9f83e323225efbe99a0670d481a7fbd1f8dbef", type: "movie", title: "PelicuLatino", name: "Acusada", genres: ['Crimen', 'Drama', 'Suspenso'], imdbRating: "6.1/10", releaseInfo: "2018", director: ['Gonzalo Tobal'], cast: ['Lali Espósito', 'Leonardo Sbaraglia', 'Inés Estévez', 'Daniel Fanego', 'Gerardo Romano', 'Gael García Bernal', 'Martina Campos', 'Debora Dejtiar', 'Ana Garibaldi', 'Margarita Molfino'], description: "Dolores lleva una vida estudiantil normal hasta que su mejor amiga es brutalmente asesinada. Dos años después, es la única acusada del crimen en un caso con gran cobertura mediática y todos tienen una opinión de su inocencia o culpabilidad." },
    "tt6483364": { infoHash: "f96a30703f35756932627cd064754612efc9d730", type: "movie", title: "PelicuLatino", name: "Alcanzando tu sueño", genres: ['Drama', 'Música'], imdbRating: "6.2/10", releaseInfo: "2018", director: ['Max Minghella'], cast: ['Elle Fanning', 'Agnieszka Grochowska', 'Archie Madekwe', 'Zlatko Buric', 'Millie Brady', 'Vivian Oparah', 'Ria Zmitrowicz', 'Olive Gray', 'Andrew Ellis', 'Marius De Vries'], description: "Violet es una tímida adolescente que sueña con escapar de su pueblo y perseguir su pasión por el canto. Con la ayuda de un mentor, entra a una competición que probará su integridad, talento y ambición." },
    "tt1979376": { infoHash: "b8a713fcc8b61b39d16d00834abc70f6fb0642fb", type: "movie", title: "PelicuLatino", name: "Toy Story 4", genres: ['Animación', 'Aventura', 'Comedia'], imdbRating: "8.1/10", releaseInfo: "2019", director: ['Josh Cooley'], cast: ['Tom Hanks', 'Tim Allen', 'Annie Potts', 'Tony Hale', 'Keegan-Michael Key', 'Madeleine McGraw', 'Christina Hendricks', 'Jordan Peele', 'Keanu Reeves', 'Ally Maki'], description: "Cuando un nuevo juguete llamado Forky se une a Woody y el resto del grupo, un viaje en carretera junto a viejos y nuevos amigos revela qué tan grande puede ser el mundo para un juguete.Películas de Toy Story" },
    "tt8328716": { infoHash: "7fb2d8dbd648c0e120f5d94acdc9dbb4c3b1d907", type: "movie", title: "PelicuLatino", name: "Doom: Aniquilación", genres: ['Acción', 'Terror', 'Ciencia ficción'], imdbRating: "-/10", releaseInfo: "2019", director: ['Tony Giglio'], cast: ['Louis Mandylor', 'Amy Manson', 'Nina Bergman', 'Kate Nichols', 'Dominic Mafham', 'Lorina Kamburova', 'Luke Allen-Gale', 'Amer Chadha-Patel', 'Hari Dhillon', 'Jemma Moore'], description: "Un grupo de marines de la UAC responde a una llamada de auxilio en una base científica secreta en Phobos, una luna de Marte, para descubrir que ha sido invadida por demonios que amenazan con llevar el infierno a la Tierra." },
