    "tt9252508": { infoHash: "8a5c839fc4f09b4a3575c4476fbb6317d6096c54", type: "movie", title: "PelicuLatino", name: "A mi altura", genres: ['Comedia'], imdbRating: "5.5/10", releaseInfo: "2019", director: ['Nzingha Stewart'], cast: ['Ava Michelle', 'Griffin Gluck', 'Sabrina Carpenter', 'Paris Berelc', 'Luke Eisner', 'Clara Wilsey', 'Angela Kinsey', 'Steve Zahn', 'Anjelika Washington', 'Rico Paris', 'Bria Condon'], description: "Jodi, la chica más alta de su escuela, nunca se sintió cómoda con ella misma. Pero tras años de agacharse, ser la burla y tratar de no atraer la atención a toda costa, finalmente decide encontrar la confianza para caminar con la frente en alto." },
