    "tt9024106": { infoHash: "0eab1fca44f56ee2d0d003f0ce71755052082074", type: "movie", title: "PelicuLatino", name: "Unplanned", genres: ['Biografía', 'Drama'], imdbRating: "6.1/10", releaseInfo: "2019", director: ['Chuck Konzelman', 'Cary Solomon'], cast: ['Ashley Bratcher', 'Brooks Ryan', 'Robia Scott', 'Jared Lotz', 'Emma Elle Roberts', 'Robin DeMarco', 'Robert Thomason', 'Tina Toner', 'Sarah Hernandez', 'Maura Corsini'], description: "Todo lo que Abby Johnson quería era ayudar a las mujeres. Como joven directora de la clínica de Planificación Familiar, ella creía en el derecho a escoger de la mujer. Hasta el día que vió algo que lo cambió todo. Basada en una historia real." },
