    "tt10240612": { infoHash: "915b31a395ee86c3ed741e01d286f8eee098d6c0", type: "movie", title: "PelicuLatino", name: "¡Critters al ataque!", genres: ['Comedia', 'Terror', 'Ciencia ficción'], imdbRating: "3.6/10", releaseInfo: "2019", director: ['Bobby Miller'], cast: ['Tashiana Washington', 'Dee Wallace', 'Jaeden Noel', 'Jack Fulton', 'Ava Preston', 'Leon Clingman', 'Vash Singh', 'Keith Arbuthnot', 'Steve Blum', 'Ho Chow', 'Alex Jeaven', 'Nathan Lynn'], description: "Drea está trabajando de niñera cuidando a Trissy y Jake, junto con su propio hermano menor Phillip, cuando decide llevarlos a pasear para mantenerlos distraídos, sin saber que unas misteriosas criaturas extraterrestres aterrizaron y empezaron a devorar a todo ser vivo que encuentran." },
