    "tt4995776": { infoHash: "1b55a0c14a098d0b3ad39a3de4046c2298d5a0c6", type: "movie", title: "PelicuLatino", name: "Operación hermanos", genres: ['Drama', 'Historia', 'Suspenso'], imdbRating: "6.2/10", releaseInfo: "2019", director: ['Gideon Raff'], cast: ['Chris Evans', 'Haley Bennett', 'Alona Tal', 'Michiel Huisman', 'Ben Kingsley', 'Michael Kenneth Williams', 'Alex Hassell', 'Alessandro Nivola', 'Greg Kinnear', 'Chris Chalk'], description: "Un grupo de agentes secretos del Mossad y valientes etíopes usan un complejo de vacaciones desierto para pasar clandestinamente miles de refugiados hacia Israel. Inspirada en hechos reales." },
    "tt4154796": { infoHash: "17b98945e41da1eb3f59979f80b71e32e380d33d", type: "movie", title: "PelicuLatino", name: "Avengers: Endgame", genres: ['Acción', 'Aventura', 'Ciencia ficción'], imdbRating: "8.7/10", releaseInfo: "2019", director: ['Anthony Russo', 'Joe Russo'], cast: ['Robert Downey Jr.', 'Chris Evans', 'Mark Ruffalo', 'Chris Hemsworth', 'Scarlett Johansson', 'Jeremy Renner', 'Don Cheadle', 'Paul Rudd', 'Benedict Cumberbatch', 'Chadwick Boseman'], description: "Después de la devastadora lucha contra Thanos, el universo queda en ruinas. Con la ayuda de los aliados restantes, los Vengadores se juntan una vez más para intentar revertir las acciones de Thanos y restaurar el balance al universo.Universo Marvel" },
