    "tt2139881": { infoHash: "5953e3cbdd8f93784033b98bd492b5ffa688c5d2", type: "movie", title: "PelicuLatino", name: "Ni en tus sueños", genres: ['Comedia', 'Romance'], imdbRating: "7.1/10", releaseInfo: "2019", director: ['Jonathan Levine'], cast: ['Charlize Theron', 'Seth Rogen', 'June Diane Raphael', 'OShea Jackson Jr.', 'Ravi Patel', 'Bob Odenkirk', 'Andy Serkis', 'Randall Park', 'Tristan D. Lalla', 'Alexander Skarsgård'], description: "El periodista Fred Flarsky se reencuentra con su amor de infancia, Charlotte Field, ahora una de las mujeres más influyentes del mundo. Mientras se prepara para postularse para la presidencia, Charlotte contrata a Fred como escritor y surgen chispas entre ellos." },
