    "tt7214470": { infoHash: "a1a67efa96d60f1450384a1ecea9aa6ebc1e58d8", type: "movie", title: "PelicuLatino", name: "El manicomio: La cuna del terror", genres: ['Terror', 'Suspenso'], imdbRating: "4.1/10", releaseInfo: "2018", director: ['Michael David Pate'], cast: ['Nilam Farooq', 'Farina Flebbe', 'Sonja Gerhardt', 'Maxine Kazis', 'Lisa-Marie Koroll', 'Emilio Sakraya', 'Tim Oliver Schultz', 'Davis Schulz', 'Timmi Trinks'], description: "En un manicomio abandonado cerca de Berlín, un grupo de youtubers entra ilegalmente al bloque de cirugía para un reto de 24 horas esperando hacerse virales. Pero pronto descubren que no están solos y que tampoco son bienvenidos." },
