    "tt3829266": { infoHash: "7971e7785f891b9a7fe12f79f5b94003fe98fffb", type: "movie", title: "PelicuLatino", name: "El Depredador", genres: ['Acción', 'Aventura', 'Terror'], imdbRating: "5.5/10", releaseInfo: "2018", director: ['Shane Black'], cast: ['Boyd Holbrook', 'Trevante Rhodes', 'Jacob Tremblay', 'Keegan-Michael Key', 'Olivia Munn', 'Sterling K. Brown', 'Thomas Jane', 'Alfie Allen', 'Augusto Aguilera', 'Jake Busey'], description: "Cuando un niño accidentalmente provoca el regreso de los cazadores más letales del universo a la Tierra, solo un equipo de ex soldados y una científica pueden prevenir el fin de la raza humana." },
