    "tt6854672": { infoHash: "c48cd3a45a64d86fbe6aaedb72f45b8e57c45cb4", type: "movie", title: "PelicuLatino", name: "Battle", genres: ['Drama'], imdbRating: "6.1/10", releaseInfo: "2018", director: ['Katarina Launing'], cast: ['Achmed Akkabi', 'Lisa Teige', 'Vebjørn Enger', 'Karen-Lise Mynster', 'Stig R. Amdam', 'Fabian Svegaard Tapia', 'Lucas Lute', 'Silje Marie Baltzersen', 'Sofie Albertine Foss'], description: "Aparentemente Amalie lo tiene todo, pero lo pierde todo un día y debe alejarse de la vida que conoce - entonces conoce a Mikael, un bailarín de hip-hop, que es bueno en batallas." },
    "tt5591666": { infoHash: "d886908351df2637c5408313b48f2724f6c49ff6", type: "movie", title: "PelicuLatino", name: "The Domestics", genres: ['Ciencia ficción', 'Suspenso'], imdbRating: "5.7/10", releaseInfo: "2018", director: ['Mike P. Nelson'], cast: ['Kate Bosworth', 'Tyler Hoechlin', 'Sonoya Mizuno', 'Lance Reddick', 'Kaden Washington Lewis', 'Jacinte Blankenship', 'Mikaela Kimani Armstrong', 'David Dastmalchian', 'Jeff Chase'], description: "En un aterrador mundo post apocalíptico habitado por pandillas divididas en facciones mortales, una pareja cruza desesperadamente el campo en búsqueda de seguridad y deben trabajar juntos para poder sobrevivir." },
    "tt5628418": { infoHash: "55408652ad5d062ab74c5828bef5d57f7b851d63", type: "movie", title: "PelicuLatino", name: "La leyenda del gigante de la montaña", genres: ['Aventura'], imdbRating: "6.1/10", releaseInfo: "2017", director: ['Mikkel Brænne Sandemose'], cast: ['Vebjørn Enger', 'Eili Harboe', 'Mads Sjøgård Pettersen', 'Elias Holmen Sørensen', 'Allan Hyde', 'Gisken Armand', 'Gard B. Eidsvold', 'Synnøve Macody Lund', 'Thorbjørn Harr'], description: "Espen, el hijo de un pobre granjero, se embarca en una peligrosa misión con sus hermanos para rescatar a la princesa de un vil troll conocido como el Rey de la Montaña, para recibir una recompensa y salvar a su familia de la ruina." },
