    "tt6182908": { infoHash: "9d066a92cfb910479e03cb9e876ad04f60401c74", type: "movie", title: "PelicuLatino", name: "Pie Pequeño", genres: ['Animación', 'Aventura', 'Comedia'], imdbRating: "6.7/10", releaseInfo: "2018", director: ['Karey Kirkpatrick', 'Jason Reisig'], cast: ['Channing Tatum', 'James Corden', 'Zendaya', 'Common', 'LeBron James', 'Danny DeVito', 'Gina Rodriguez', 'Yara Shahidi', 'Ely Henry', 'Jimmy Tatro', 'Patricia Heaton'], description: "Un yeti llamado Migo está convencido de que un humano conocido solo como Pie Pequeño es real y tiene que probarle a su tribu de que sí existe con la ayuda de Meechee." },
    "tt1308728": { infoHash: "23f7c6529f9d35ffb2be35edc1681a40e115f6dc", type: "movie", title: "PelicuLatino", name: "¿Quien mató a los Puppets?", genres: ['Acción', 'Comedia', 'Crimen'], imdbRating: "5.2/10", releaseInfo: "2018", director: ['Brian Henson'], cast: ['Melissa McCarthy', 'Elizabeth Banks', 'Maya Rudolph', 'Leslie David Baker', 'Joel McHale', 'Cynthy Wu', 'Michael McDonald', 'Mitch Silpa', 'Hemky Madera', 'Benjamin Cole Royer'], description: "Cuando los protagonistas puppets de un popular programa de TV comienzan a ser asesinados uno por uno, un puppet ex oficial de policía, que ahora es detective privado, toma el caso." },
