    "tt6218358": { infoHash: "7c5a25793800ba722d1d1e99215c9e22d0afba98", type: "movie", title: "PelicuLatino", name: "Calibre", genres: ['Suspenso'], imdbRating: "6.7/10", releaseInfo: "2018", director: ['Matt Palmer'], cast: ['Jack Lowden', 'Martin McCann', 'Tony Curran', 'Ian Pirie', 'George Anton', 'Kate Bracken', 'Therese Bradley', 'Joe Cassidy', 'Cameron Jack', 'Kitty Lovett', 'Cal MacAninch'], description: "Un terrible hecho convirtió su viaje de fin de semana en una pesadilla. Ahora su única esperanza es aguantar su paranoia y actuar de manera normal." },
