    "tt7690670": { infoHash: "5a406383d7b75fa013c070741fe87b3ceec48312", type: "movie", title: "PelicuLatino", name: "El supremo", genres: ['Acción', 'Crimen', 'Suspenso'], imdbRating: "5.1/10", releaseInfo: "2018", director: ['Director X.'], cast: ['Trevor Jackson', 'Jason Mitchell', 'Michael Kenneth Williams', 'Lex Scott Davis', 'Jennifer Morrison', 'Esai Morales', 'Andrea Londo', 'Big Boi', 'Jacob Ming-Trent', 'Dominique Madison'], description: "Cuando un experimentado joven traficante de cocaína en Atlanta se da cuenta de que debe salirse del juego cuanto antes, decide arriesgar todo en un último gran trabajo entre  colegas pistoleros y la policía." },
    "tt4244998": { infoHash: "ee0212fe6dda45a8814222ed4a90e2686d19a0e0", type: "movie", title: "PelicuLatino", name: "Alfa", genres: ['Aventura', 'Drama', 'Familiar'], imdbRating: "6.8/10", releaseInfo: "2018", director: ['Albert Hughes'], cast: ['Kodi Smit-McPhee', 'Jóhannes Haukur Jóhannesson', 'Marcin Kowalczyk', 'Jens Hultén', 'Natassia Malthe', 'Spencer Bogaert', 'Mercedes de la Zerda', 'Leonor Varela', 'Morgan Freeman'], description: "En el pasado prehistórico, un joven lucha para regresar a su hogar después de ser separado de su tribu durante una cacería de búfalos. En el camino encuentra un lobo igualmente solitario y comienza una amistad que cambiaría la humanidad." },
