    "tt8954732": { infoHash: "73b9f974085bbc72a01ac5bd4eac45e5bea3f855", type: "movie", title: "PelicuLatino", name: "Intercambio de princesas", genres: ['Romance'], imdbRating: "6.2/10", releaseInfo: "2018", director: ['Mike Rohl'], cast: ['Vanessa Hudgens', 'Sam Palladio', 'Nick Sagar', 'Alexa Adeosun', 'Suanne Braun', 'Mark Fleischmann', 'Sara Stewart', 'Amy Griffiths', 'Robin Soans Taylor', 'Jo Cameron Brown'], description: "Una semana antes de Navidad, Margaret, la bella Duquesa de Montenaro, intercambia lugares con Stacy, una joven regular de Chicago, que se ve exactamente igual a ella, para experimentar la vida como una persona normal antes del día de su boda." },
