    "tt3766354": { infoHash: "1b91f931ed604dbe5f65578bb0043561b3029f1a", type: "movie", title: "PelicuLatino", name: "El justiciero 2", genres: ['Acción', 'Crimen', 'Suspenso'], imdbRating: "6.8/10", releaseInfo: "2018", director: ['Antoine Fuqua'], cast: ['Denzel Washington', 'Pedro Pascal', 'Ashton Sanders', 'Orson Bean', 'Bill Pullman', 'Melissa Leo', 'Jonathan Scarfe', 'Sakina Jaffrey', 'Kazy Tauginas', 'Garrett Golden'], description: "Robert McCall, un agente retirado de las operaciones secretas de la CIA, sirve justicia para los explotados y oprimidos, pero ¿qué tan lejos puede llegar cuando es alguien que ama?" },
    "tt3104988": { infoHash: "ced1494cc5d1489e732e832096fc59fdf40b8f99", type: "movie", title: "PelicuLatino", name: "Locamente millonarios", genres: ['Comedia', 'Romance'], imdbRating: "7.3/10", releaseInfo: "2018", director: ['Jon M. Chu'], cast: ['Constance Wu', 'Henry Golding', 'Michelle Yeoh', 'Gemma Chan', 'Lisa Lu', 'Awkwafina', 'Harry Shum Jr.', 'Ken Jeong', 'Sonoya Mizuno', 'Chris Pang', 'Jimmy O. Yang', 'Ronny Chieng'], description: "Rachel Chu, de Nueva York, viaja a la ciudad natal de su novio Nick en Singapur para la boda de su mejor amigo en donde pronto descubre su secreto: Nick es de una familia increíblemente adinerada y posiblemente sea el soltero más codiciado de Asia." },
