    "tt6456222": { infoHash: "662b5e0a323240b6677729923ac3e341d75a7717", type: "movie", title: "PelicuLatino", name: "Nostalgia", genres: ['Drama'], imdbRating: "5.3/10", releaseInfo: "2018", director: ['Mark Pellington'], cast: ['Hugo Armstrong', 'Shinelle Azoroh', 'Annalise Basso', 'Ellen Burstyn', 'Bruce Dern', 'Chloe Farnworth', 'Joanna Going', 'Beth Grant', 'Arye Gross', 'Jon Hamm', 'Catherine Keener'], description: "Un mosaico de historias acerca de amor y pérdida, explorando nuestra relación hacia los objetos, artefactos y memorias que moldean nuestras vidas." },
    "tt6679794": { infoHash: "d004abd4b2d4800ac78982bbb5ab2b5af7db5638", type: "movie", title: "PelicuLatino", name: "Legítimo rey", genres: ['Acción', 'Drama'], imdbRating: "7.2/10", releaseInfo: "2018", director: ['David Mackenzie'], cast: ['Chris Pine', 'Stephen Dillane', 'Rebecca Robin', 'Billy Howle', 'Paul Blair', 'Sam Spruell', 'Jonny Phillips', 'Ben Clifford', 'Jamie Maclachlan', 'Steven Cree', 'Tony Curran', 'James Cosmo'], description: "Escocia, siglo XIV, luego de ser declarado forajido por el ejército invasor inglés, Roberto I logra reunir un ejército de combatientes escoceses para rebelarse y reconquistar la independencia del país." },
    "tt7349662": { infoHash: "5f19ec5d38cf868235cd70997e894d14442922f7", type: "movie", title: "PelicuLatino", name: "Infiltrado del KKKlan", genres: ['Comedia', 'Crimen', 'Biografía'], imdbRating: "7.7/10", releaseInfo: "2018", director: ['Spike Lee'], cast: ['Alec Baldwin', 'John David Washington', 'Adam Driver', 'Isiah Whitlock Jr.', 'Robert John Burke', 'Brian Tarantina', 'Arthur J. Nascarella', 'Ken Garito', 'Michael Buscemi', 'Laura Harrier'], description: "Ron Stallworth, un oficial de policía afroamericano de Colorado, consigue infiltrarse exitosamente en la organización local del Ku Klux Klan con la ayuda de su colega judío. Basada en hechos reales." },
    "tt3892172": { infoHash: "cf826d72231d245bde13c585835238e22a18e07f", type: "movie", title: "PelicuLatino", name: "Sin rastro", genres: ['Drama'], imdbRating: "7.2/10", releaseInfo: "2018", director: ['Debra Granik'], cast: ['Thomasin McKenzie', 'Ben Foster', 'Jeffery Rifflard', 'Derek John Drescher', 'Michael Draper', 'Peter Simpson', 'Erik McGlothlin', 'Dana Millican', 'Jeff Kober', 'Spencer S. Hanley'], description: "Un padre y su hija de trece años viven una existencia ideal en un extenso parque urbano en Portland, Oregon, cuando un pequeño error descarrila sus vidas para siempre." },
