    "tt3411444": { infoHash: "ab024d995d3467e7603e51ed269f9d428790f901", type: "movie", title: "PelicuLatino", name: "Olé: El viaje de Ferdinand", genres: ['Animación', 'Aventura', 'Comedia'], imdbRating: "6.7/10", releaseInfo: "2017", director: ['Carlos Saldanha'], cast: ['John Cena', 'Kate McKinnon', 'Juanes', 'Carlos Saldanha', 'Jerrod Carmichael', 'Julia Scarpa Saldanha', 'Lily Day'], description: "Después de que Ferdinand, un gran toro con un gran corazón, sea confundido con una bestia peligrosa, es capturado y alejado de su hogar. Determinado a regresar con su familia, reúne a un grupo de inadaptados para una increíble aventura." },
    "tt4587656": { infoHash: "f0f1f6125831d0525f4c3c343ee7e1ded234f85e", type: "movie", title: "PelicuLatino", name: "La estrella de Belén", genres: ['Animación', 'Aventura', 'Comedia'], imdbRating: "5.8/10", releaseInfo: "2017", director: ['Timothy Reckart'], cast: ['Steven Yeun', 'Keegan-Michael Key', 'Aidy Bryant', 'Gina Rodriguez', 'Zachary Levi', 'Christopher Plummer', 'Ving Rhames', 'Gabriel Iglesias', 'Anthony Anderson', 'Mariah Carey', 'Oprah Winfrey'], description: "Bo es un valiente burro que sueña con tener una vida más allá del trabajo en el molino. Un día finalmente sale en busca de la aventura soñada y junto con sus amigos se convierten en los héroes desconocidos de la primera Navidad." },
    "tt6408226": { infoHash: "58547d9822d066bb618d1b17b18dbfd2ec009444", type: "movie", title: "PelicuLatino", name: "Newness", genres: ['Drama', 'Romance'], imdbRating: "6.4/10", releaseInfo: "2017", director: ['Drake Doremus'], cast: ['Nicholas Hoult', 'Laia Costa', 'Danny Huston', 'Courtney Eaton', 'Matthew Gray Gubler', 'Pom Klementieff', 'David Selby', 'Amanda Serra', 'Jessica Henwick'], description: "En Los Angeles, dos millenials empiezan una relación que pondrá a prueba sus límites emocionales y físicos, ya que la tentación de ligar por internet no es fácil de resistir." },
    "tt7057496": { infoHash: "38747e703fa8e2d2cd5fe231684a1132e27559d8", type: "movie", title: "PelicuLatino", name: "Olvidado", genres: ['Misterio', 'Suspenso'], imdbRating: "6.9/10", releaseInfo: "2017", director: ['Hang-jun Zhang'], cast: ['Ha-Neul Kang', 'Mu-Yeol Kim', 'Seong-kun Mun', 'Young-hee Na'], description: "Una noche lluviosa, Jin-Seok ve cómo su hermano mayor es secuestrado. Luego de 19 días de silencio, su hermano regresa pero no recuerda nada de su desaparición, además de que su personalidad y comportamiento son muy diferentes, así que Jin-Seok decide averiguar qué fue lo que sucedió." },
    "tt1464763": { infoHash: "867400c0a25c758742f689908b91e721f752fc24", type: "movie", title: "PelicuLatino", name: "Mudo", genres: ['Misterio', 'Ciencia ficción', 'Suspenso'], imdbRating: "5.5/10", releaseInfo: "2018", director: ['Duncan Jones'], cast: ['Alexander Skarsgård', 'Paul Rudd', 'Justin Theroux', 'Seyneb Saleh', 'Robert Sheehan', 'Daniel Fathers', 'Nikki Lamborn', 'Noel Clarke'], description: "Berlín dentro de cuarenta años. Un bartender mudo se enfrenta a los criminales de la ciudad en un intento de descubrir qué le pasó a su compañera que está desaparecida." },
