    "tt4429194": { infoHash: "e794518aa5f97b94c4ee1874264ccefbeee687a7", type: "movie", title: "PelicuLatino", name: "París puede esperar", genres: ['Comedia', 'Drama', 'Romance'], imdbRating: "5.7/10", releaseInfo: "2016", director: ['Eleanor Coppola'], cast: ['Diane Lane', 'Arnaud Viard', 'Alec Baldwin', 'Elise Tielrooy', 'Élodie Navarre', 'Serge Onteniente', 'Pierre Cuq', 'Cédric Monnet', 'Aurore Clément'], description: "La esposa de un exitoso productor de cine viaja por carretera desde el sur de Francia hasta París con uno de los socios de su esposo. El que debía haber sido un viaje de siete horas se convierte en una aventura de dos días repleta de pintorescos paisajes, comida, vino, sabiduría y romance." },
