    "tt5027774": { infoHash: "30dfd8d59941b7a6a69477b17294859c574efe2b", type: "movie", title: "PelicuLatino", name: "Tres anuncios por un crimen", genres: ['Crimen', 'Drama'], imdbRating: "8.3/10", releaseInfo: "2017", director: ['Martin McDonagh'], cast: ['Frances McDormand', 'Caleb Landry Jones', 'Kerry Condon', 'Sam Rockwell', 'Darrell Britt-Gibson', 'Woody Harrelson', 'Abbie Cornish', 'Peter Dinklage', 'Riya May Atwood'], description: "La madre de una niña que fue violada y asesinada hace unos meses alquila tres anuncios para desafiar a las autoridades locales a que resuelvan el crimen porque piensa que no han hecho todo lo posible para atrapar al culpable." },
    "tt1230168": { infoHash: "7e71c2b0e74f76b3e5b36f078c4f0a30036f3915", type: "movie", title: "PelicuLatino", name: "Same Kind of Different as Me", genres: ['Drama'], imdbRating: "6.2/10", releaseInfo: "2017", director: ['Michael Carney'], cast: ['Renée Zellweger', 'Jon Voight', 'Djimon Hounsou', 'Greg Kinnear', 'Olivia Holt', 'Dana Gourrier', 'Stephanie Leigh Schlund', 'Ann Mahoney', 'Peyton Wich', 'Lara Grice', 'Tonea Stewart'], description: "El comerciante internacional de arte Ron Hall debe entablar amistad con un peligroso hombre sin hogar para salvar su matrimonio en dificultades, y los sueños de su esposa los llevarán a los tres en el viaje de sus vidas." },
    "tt3501632": { infoHash: "432b72ec6da5e3078536912592ba78e9bab61be4", type: "movie", title: "PelicuLatino", name: "Thor: Ragnarok", genres: ['Acción', 'Aventura', 'Comedia'], imdbRating: "8.0/10", releaseInfo: "2017", director: ['Taika Waititi'], cast: ['Chris Hemsworth', 'Tom Hiddleston', 'Cate Blanchett', 'Idris Elba', 'Jeff Goldblum', 'Tessa Thompson', 'Karl Urban', 'Mark Ruffalo', 'Anthony Hopkins', 'Benedict Cumberbatch', 'Taika Waititi', 'Rachel House', 'Clancy Brown', 'Tadanobu Asano', 'Ray Stevenson'], description: "Thor está atrapado en el otro lado del universo y se encuentra en una carrera contra el tiempo para regresar a Asgard y detener el Ragnarok: la destrucción de su tierra y el fin de la civilización asgardiana, todo a manos de una nueva y poderosa amenaza, la despiadada Hela.Universo Marvel" },
    "tt4555426": { infoHash: "b57aa457af100e2080d37e2038d10db95dd91754", type: "movie", title: "PelicuLatino", name: "Las horas más oscuras", genres: ['Biografía', 'Drama', 'Historia'], imdbRating: "7.4/10", releaseInfo: "2017", director: ['Joe Wright'], cast: ['Gary Oldman', 'Kristin Scott Thomas', 'Ben Mendelsohn', 'Lily James', 'Ronald Pickup', 'Stephen Dillane', 'Nicholas Jones', 'Samuel West', 'David Schofield', 'Richard Lumsden', 'Malcolm Storry', 'Hilton McRae', 'Benjamin Whitrow', 'Joe Armstrong', 'Adrian Rawlins'], description: "Durante los primeros días de la Segunda Guerra Mundial, el destino de Europa Occidental depende del nuevo Primer Ministro Británico, Winston Churchill, quien debe decidir entre negociar con Adolf Hitler o luchar en condiciones muy desfavorables." },
    "tt0974015": { infoHash: "8c7b9998a5585ee5f5d1a56a5934bafa79214694", type: "movie", title: "PelicuLatino", name: "Liga de la Justicia", genres: ['Acción', 'Aventura', 'Fantasía'], imdbRating: "6.9/10", releaseInfo: "2017", director: ['Zack Snyder'], cast: ['Ben Affleck', 'Henry Cavill', 'Amy Adams', 'Gal Gadot', 'Ezra Miller', 'Jason Momoa', 'Ray Fisher', 'Jeremy Irons', 'Diane Lane', 'Connie Nielsen', 'J.K. Simmons', 'Ciarán Hinds', 'Amber Heard', 'Joe Morton', 'Lisa Loven Kongsli'], description: "Con su fe en la humanidad restaurada e inspirado por el acto altruista de Superman, Bruce Wayne recibe la ayuda de su nueva aliada, Diana Prince, para enfrentar un enemigo más grande. Juntos, Batman y Wonder Woman trabajan para encontrar y reclutar un equipo de metahumanos para combatir la amenaza.Universo DC" },
    "tt4645368": { infoHash: "759e4f770430d88603c3dbe60febf70cb5d96ed0", type: "movie", title: "PelicuLatino", name: "No es más que el fin del mundo", genres: ['Drama'], imdbRating: "6.9/10", releaseInfo: "2016", director: ['Xavier Dolan'], cast: ['Nathalie Baye', 'Vincent Cassel', 'Marion Cotillard', 'Léa Seydoux', 'Gaspard Ulliel', 'Antoine Desrochers', 'William Boyce Blanchette', 'Sasha Samar', 'Arthur Couillard', 'Emile Rondeau', 'Théodore Pellerin', 'Jenyane Provencher'], description: "Después de doce años de ausencia y a pesar del miedo, Louis, un escritor que padece una enfermedad terminal, regresa a su casa con la idea de comunicarle a su familia que está muriendo." },
