    "tt5221584": { infoHash: "afbac7fba87d89836e5a4ab113ff82c0ea1e61f0", type: "movie", title: "PelicuLatino", name: "Aquarius", genres: ['Drama'], imdbRating: "7.6/10", releaseInfo: "2016", director: ['Kleber Mendonça Filho'], cast: ['Sônia Braga', 'Maeve Jinkings', 'Irandhir Santos', 'Humberto Carrão', 'Zoraide Coleto', 'Carla Ribas', 'Fernando Teixeira', 'Buda Lira', 'Paula De Renor', 'Barbara Colen', 'Daniel Porpino', 'Pedro Queiroz', 'Germano Melo', 'Julia Bernat', 'Thaia Perez'], description: "Clara, una viuda de 65 años y crítica de música retirada, es la última residente del edificio Aquarius en Recife, levantado en 1940. Todos los otros departamentos ya fueron comprados por una empresa, pero Clara hizo una promesa de dejar su hogar solamente cuando muera." },
