    "tt6142314": { infoHash: "33e9e248d1582f6783407325bd6ee33da70d1631", type: "movie", title: "PelicuLatino", name: "Batman vs. Dos Caras", genres: ['Animación', 'Acción', 'Comedia'], imdbRating: "6.2/10", releaseInfo: "2017", director: ['Rick Morales'], cast: ['Adam West', 'Burt Ward', 'William Shatner', 'Julie Newmar', 'Jeff Bergman', 'Sirena Irwin', 'Thomas Lennon', 'Lee Meriwether', 'William Salyers', 'Lynne Marie Stewart', 'Jim Ward', 'Steven Weber', 'Wally Wingert'], description: "El ex fiscal de distrito de la ciudad de Gotham, Harvey Dent, comienza una ola de crímenes después de que un lado de su cara quedara marcado con ácido. Todas sus acciones las decide con el lanzamiento de una moneda de plata." },
