    "tt3450958": { infoHash: "96a1765e16514d5d586d900e9738a7b8ac90a496", type: "movie", title: "PelicuLatino", name: "El planeta de los simios: La guerra", genres: ['Acción', 'Aventura', 'Drama'], imdbRating: "7.7/10", releaseInfo: "2017", director: ['Matt Reeves'], cast: ['Andy Serkis', 'Woody Harrelson', 'Steve Zahn', 'Karin Konoval', 'Amiah Miller', 'Terry Notary', 'Ty Olsson', 'Michael Adamthwaite', 'Toby Kebbell', 'Gabriel Chavarria', 'Judy Greer', 'Sara Canning', 'Devyn Dalton', 'Aleks Paunovic', 'Alessandro Juliani'], description: "Después de que los simios sufrieran pérdidas inimaginables debido a un conflicto con los humanos, Caesar lucha con sus instintos más oscuros y comienza su propia misión para vengar a su especie.Películas de El planeta de los simios" },
    "tt5140878": { infoHash: "544744ce55ff23b2fed49f95197689149a60ba8f", type: "movie", title: "PelicuLatino", name: "Annabelle 2: La creación", genres: ['Terror', 'Misterio', 'Suspenso'], imdbRating: "6.8/10", releaseInfo: "2017", director: ['David F. Sandberg'], cast: ['Anthony LaPaglia', 'Samara Lee', 'Miranda Otto', 'Brad Greenquist', 'Lulu Wilson', 'Talitha Eliana Bateman', 'Stephanie Sigman', 'Mark Bramhall', 'Grace Fulton', 'Philippa Coulthard', 'Tayler Buck', 'Lou Lou Safran', 'Joseph Bishara', 'Alicia Vela-Bailey', 'Lotta Losten'], description: "Doce años después de la trágica muerte de su hija, un fabricante de muñecas y su esposa reciben en su casa a una monja y varias niñas de un orfanato, donde pronto se convierten en el blanco de una de las creaciones del fabricante: Annabelle." },
    "tt1959563": { infoHash: "530c56f11a14eb8a10e5bc1b05925d27b4115980", type: "movie", title: "PelicuLatino", name: "Duro de cuidar", genres: ['Acción', 'Comedia'], imdbRating: "7.0/10", releaseInfo: "2017", director: ['Patrick Hughes'], cast: ['Elodie Yung', 'Ryan Reynolds', 'Samuel L. Jackson', 'Tsuwayuki Saotome', 'Roy Hill', 'Richard E. Grant', 'Gary Oldman', 'Rod Hallett', 'Yuri Kolokolnikov', 'Nadia Konakchieva', 'Valentin Stojanov', 'Noortje Herlaar', 'Georgie Glen', 'Michael Gor', 'Barry Atsma', 'Ralitsa Vassileva'], description: "El mejor guardaespaldas del mundo recibe un nuevo cliente, un asesino a sueldo que debe testificar ante la Corte Internacional de Justicia. Deben dejar sus diferencias de lado y trabajar juntos para poder llegar al juicio." },
