    "tt0775440": { infoHash: "bcb0ecee7211941c9a7ae35431fd229bbdf9d966", type: "movie", title: "PelicuLatino", name: "Conexión Mortal", genres: ['Acción', 'Drama', 'Terror'], imdbRating: "4.3/10", releaseInfo: "2016", director: ['Tod Williams'], cast: ['John Cusack', 'Samuel L. Jackson', 'Isabelle Fuhrman', 'Clark Sarullo', 'Ethan Andrew Casto', 'Owen Teague', 'Stacy Keach', 'Joshua Mikel', 'Anthony Reynolds', 'Erin Elizabeth Burns', 'Jeff Hallman', 'Mark Ashworth', 'Wilbur Fitzgerald', 'Catherine Dyer', 'E. Roger Mitchell'], description: "Cuando una extraña señal pasa a través de las redes de telefonía celular del mundo, comienza una epidemia asesina cuando los usuarios se convierten en criaturas sanguinarias. Un grupo de personas queda entre los sobrevivientes para luchar con el caos que sigue." },
