    "tt3564472": { infoHash: "8d0028ba0b6cb03ec410539847f5669eb0ce07e6", type: "movie", title: "PelicuLatino", name: "Viaje de chicas", genres: ['Comedia'], imdbRating: "6.7/10", releaseInfo: "2017", director: ['Malcolm D. Lee'], cast: ['Regina Hall', 'Queen Latifah', 'Jada Pinkett Smith', 'Tiffany Haddish', 'Larenz Tate', 'Mike Colter', 'Kate Walsh', 'Kofi Siriboe', 'Lara Grice', 'Deborah Ayorinde', 'Janeline Hayes', 'Wild Wayne', 'Sunny Hostin', 'Nick Mundy', 'Ricky Wayne'], description: "Cuando cuatro amigas de toda la vida viajan a Nueva Orleans para un festival anual, su amistad es reavivada, se descubren lados salvajes, y hay suficiente baile, alcohol, peleas y romance para sonrojar a cualquiera." },
    "tt4943322": { infoHash: "17d57a3aeb91f2f37bb514ff63a4795a11e8eafc", type: "movie", title: "PelicuLatino", name: "Entre la guerra y el amor", genres: ['Drama'], imdbRating: "7.0/10", releaseInfo: "2017", director: ['Joseph Ruben'], cast: ['Michiel Huisman', 'Hera Hilmar', 'Josh Hartnett', 'Ben Kingsley', 'Haluk Bilginer', 'Affif Ben Badra', 'Paul Barrett', 'Jessica Turner', 'Peter Hosking', 'Selçuk Yöntem', 'Eliska Slansky', 'Hasan Say', 'Deniz Kilic Flak', 'Aysen Sümercan', 'Murat Seven'], description: "Una bella enfermera, cansada de las injusticias en su país, viaja al Imperio Otomano en una remota misión médica justo antes de lo que será la Primera Guerra Mundial. Ahí encuentra su lealtad puesta a prueba cuando se enamora de un teniente del Ejército Imperial Otomano." },
