    "tt2250912": { infoHash: "eb75889f20c1b04af0d3230539628f731ba64662", type: "movie", title: "PelicuLatino", name: "Spider-Man: De regreso a casa", genres: ['Acción', 'Aventura', 'Ciencia ficción'], imdbRating: "7.8/10", releaseInfo: "2017", director: ['Jon Watts'], cast: ['Tom Holland', 'Michael Keaton', 'Robert Downey Jr.', 'Marisa Tomei', 'Jon Favreau', 'Gwyneth Paltrow', 'Zendaya', 'Donald Glover', 'Jacob Batalon', 'Laura Harrier', 'Tony Revolori', 'Bokeem Woodbine', 'Tyne Daly', 'Abraham Attah', 'Hannibal Buress'], description: "Peter Parker trata de equilibrar su vida como un estudiante regular de secundaria con su alter ego, el superhéroe Spider-Man. Debe enfrentar a una nueva amenaza que ronda los cielos de la ciudad de Nueva York.Películas de Spider ManUniverso Marvel" },
