    "tt3469046": { infoHash: "bffc180622eb63f0e9f79a104bf63eb807809fec", type: "movie", title: "PelicuLatino", name: "Mi villano favorito 3", genres: ['Animación', 'Acción', 'Aventura'], imdbRating: "6.3/10", releaseInfo: "2017", director: ['Kyle Balda'], cast: ['Steve Carell', 'Kristen Wiig', 'Trey Parker', 'Miranda Cosgrove', 'Dana Gaier', 'Nev Scharrel', 'Pierre Coffin', 'Steve Coogan', 'Julie Andrews', 'Jenny Slate', 'Michael Beattie', 'Andy Nyman', 'Adrian Ciscato', 'Brian T. Delaney', 'Katia Saponenko'], description: "Gru está pasando por una crisis de identidad cuando conoce a su encantador y mucho más exitoso hermano gemelo, Dru, quien quiere hacer equipo con él para un último golpe criminal.Serie Mi villano favorito" },
    "tt5034266": { infoHash: "0c7f5fefbbca50f25a3bf7fcde62bfcc6f9c821d", type: "movie", title: "PelicuLatino", name: "Nosotros en la noche", genres: ['Drama', 'Romance'], imdbRating: "6.9/10", releaseInfo: "2017", director: ['Ritesh Batra'], cast: ['Iain Armitage', 'Jane Fonda', 'Robert Redford', 'Judy Greer', 'Matthias Schoenaerts', 'Bruce Dern', 'Phyllis Somerville', 'Michael Love Toliver', 'Leana Lewis', 'Audrey Walters', 'Kyrannio Margaros', 'Hawley Penfold', 'Anthoula Katsimatides', 'Kathleen Timberman', 'Fred Osborne'], description: "Addie Moore y Louis Waters son una viuda y un viudo que han vivido lado a lado durante años. Los dos no tienen casi ninguna relación entre ellos, pero todo cambia cuando Addie trata de establecer una conexión con su vecino." },
