    "tt3890160": { infoHash: "2e8f2a390bda8148a42a36688ada1400fabd1c3e", type: "movie", title: "PelicuLatino", name: "Baby: El aprendiz del crimen", genres: ['Acción', 'Crimen', 'Música'], imdbRating: "8.0/10", releaseInfo: "2017", director: ['Edgar Wright'], cast: ['Ansel Elgort', 'Jon Bernthal', 'Jon Hamm', 'Eiza González', 'Micah Howard', 'Lily James', 'Morgan Brown', 'Kevin Spacey', 'Jamie Foxx', 'Morse Diggs', 'CJ Jones', 'Sky Ferreira', 'Lance Palmer', 'Hudson Meek', 'Viviana Chavez'], description: "Baby es un joven conductor de escape que puede hacer cualquier movida cuando suena la canción correcta. Su talento es crítico para sobrevivir en este mundo, pero pronto se encuentra siendo parte de un asalto destinado a fracasar." },
    "tt5465868": { infoHash: "e9b4a60302f5499c65c74fb514b03ca175b04ea4", type: "movie", title: "PelicuLatino", name: "Me casé con un boludo", genres: ['Comedia', 'Romance'], imdbRating: "5.6/10", releaseInfo: "2016", director: ['Juan Taratuto'], cast: ['Adrián Suar', 'Valeria Bertuccelli', 'Gerardo Romano', 'Norman Briski', 'Alan Sabbagh', 'Marina Bellati', 'María Alche', 'Analía Couceyro', 'Diego Benedetto', 'Marcelo Subiotto', 'Sebastián Presta', 'Nicolás Silvert', 'María Emilia Ladogana', 'Angel De Brito', 'Marcela Coronel'], description: "Una actriz desconocida se enamora de un famoso actor. Luego de casarse, ella se da cuenta que se enamoró de un personaje que interpreta su esposo y no de la persona real." },
