    "tt6044910": { infoHash: "0c124094a3e9c840a9dfdfd28c4c4da817c4200d", type: "movie", title: "PelicuLatino", name: "Operación Mekong", genres: ['Acción', 'Aventura'], imdbRating: "6.8/10", releaseInfo: "2016", director: ['Dante Lam'], cast: ['Joyce Wenjuan Feng', 'Baoguo Chen', 'Xudong Wu', 'Wu Linkai', 'Zhan Liguo', 'Chun Sun', 'Liu Xianda', 'Ganesh Acharya', 'Oak Keerati', 'Bure Li', 'Ken Lo', 'Pawarith Monkolpisit', 'Carl Ng', 'Vithaya Pansringarm', 'Eddie Peng'], description: "Dos barcos mercantes chinos son atacados en el río Mekong y 13 miembros de la tripulación asesinados. La policía encuentra miles de tabletas de metanfetaminas en los barcos, entonces el gobierno de China envía oficiales antinarcóticos de élite al Triángulo Dorado para investigar." },
