    "tt4411596": { infoHash: "cf457a33ef9ec9ce7d61fe1eedefc0d51847f2b3", type: "movie", title: "PelicuLatino", name: "Mi prima Rachel", genres: ['Drama', 'Misterio', 'Romance'], imdbRating: "6.1/10", releaseInfo: "2017", director: ['Roger Michell'], cast: ['Iain Glen', 'Rachel Weisz', 'Sam Claflin', 'Holliday Grainger', 'Andrew Knott', 'Poppy Lee Friar', 'Simon Russell Beale', 'Pierfrancesco Favino', 'Alexander Arnold', 'Andrew Havill', 'Vicki Pepperdine', 'Harrie Hayes', 'Katherine Pearce', 'Dorian Lough', 'Deano Bugatti'], description: "Un joven inglés planea su venganza contra la misteriosa y hermosa esposa de su primo fallecido, a quien considera la responsable de su muerte. Pero sus sentimientos se complican cuando se siente atraído por sus encantos." },
