    "tt2316204": { infoHash: "99fe85dc68d2a7baa98bf8ee9f10246b3bf1ec9e", type: "movie", title: "PelicuLatino", name: "Alien: Covenant", genres: ['Terror', 'Ciencia ficción', 'Suspenso'], imdbRating: "6.6/10", releaseInfo: "2017", director: ['Ridley Scott'], cast: ['Michael Fassbender', 'Katherine Waterston', 'Billy Crudup', 'Danny McBride', 'Demián Bichir', 'Carmen Ejogo', 'Jussie Smollett', 'Callie Hernandez', 'Amy Seimetz', 'Nathaniel Dean', 'Alexander England', 'Benjamin Rigby', 'Uli Latukefu', 'Tess Haubrich', 'Lorelei King'], description: "La tripulación de la nave colonizadora Covenant, con destino a un remoto planeta, descubre lo que parece ser un paraíso inexplorado. Pero cuando surge una amenaza inimaginable deben intentar un angustioso escape.Serie Alien" },
    "tt3344680": { infoHash: "60333b5eab006f33d62f908b182f21b29fa34d2f", type: "movie", title: "PelicuLatino", name: "Boyka: Undisputed IV", genres: ['Acción', 'Crimen', 'Suspenso'], imdbRating: "7.2/10", releaseInfo: "2016", director: ['Todor Chapkanov'], cast: ['Scott Adkins', 'Teodora Duhovnikova', 'Alon Aboutboul', 'Julian Vergov', 'Brahim Achabbakhe', 'Paul Chahidi', 'Petio Petkov', 'Valentin Ganev', 'Vlado Mihailov', 'Martyn Ford', 'Vladimir Kolev', 'Hristo Petkov', 'Boris Pankin', 'Bashar Rahal', 'Emilien De Falco'], description: "Boyka tiene como meta llegar a las grandes ligas cuando una muerte accidental en el ring lo hace cuestionarse todo por lo que lucha. Cuando se entera que la viuda está en problemas, se ofrece a pelear por ella." },
