    "tt6003368": { infoHash: "b67415a7ed481bb3e60b8beaf27caed2ca97382f", type: "movie", title: "PelicuLatino", name: "Diario de Greg: Un viaje de locos", genres: ['Comedia', 'Infantil'], imdbRating: "3.8/10", releaseInfo: "2017", director: ['David Bowers'], cast: ['Jason Drucker', 'Alicia Silverstone', 'Tom Everett Scott', 'Charlie Wright', 'Owen Asztalos', 'Dylan Walters', 'Wyatt Walters', 'Joshua Hoover', 'Chris Coppola', 'Mira Silverman', 'Carlos Guerrero', 'Danny Vinson', 'Stephen Big Steve Dupree', 'Neva Howell', 'Ricky Muse'], description: "Un viaje por carretera para asistir al cumpleaños 90 de la abuela se sale cómicamente de curso gracias al nuevo plan de Greg de llegar a una convención de videojuegos. Esto se convertirá en una aventura que la familia Heffley jamá olvidará." },
