    "tt1972591": { infoHash: "0cb7428bac503393ed06097496974761f9bb6a8b", type: "movie", title: "PelicuLatino", name: "El Rey Arturo: La Leyenda de la Espada", genres: ['Acción', 'Aventura', 'Drama'], imdbRating: "7.1/10", releaseInfo: "2017", director: ['Guy Ritchie'], cast: ['Charlie Hunnam', 'Astrid Bergès-Frisbey', 'Jude Law', 'Djimon Hounsou', 'Eric Bana', 'Aidan Gillen', 'Freddie Fox', 'Craig McGinlay', 'Tom Wu', 'Kingsley Ben-Adir', 'Neil Maskell', 'Annabelle Wallis', 'Zac Barker', 'Oliver Barker', 'Geoff Bell'], description: "Robado de su derecho de nacimiento, Arturo surge de la manera difícil en los callejones de la ciudad. Pero una vez que arranca la espada de la piedra, se ve forzado a reconocer su verdadero legado, quiera o no quiera." },
