    "tt3462710": { infoHash: "194ee0dbfeda1476345f22339ac66eff2142491a", type: "movie", title: "PelicuLatino", name: "Mío o de nadie", genres: ['Drama', 'Suspenso'], imdbRating: "4.7/10", releaseInfo: "2017", director: ['Denise Di Novi'], cast: ['Rosario Dawson', 'Katherine Heigl', 'Geoff Stults', 'Isabella Kai Rice', 'Alex Quijano', 'Sarah Burns', 'Whitney Cummings', 'Simon Kassianides', 'Robert Wisdom', 'Cheryl Ladd', 'Stephanie Escajeda', 'Kincaid Walker', 'Aline Elasmar', 'Jayson Blair', 'Lauren Rose Lewis'], description: "Tessa apenas está sobrellevando el fin de su matrimonio cuando su ex esposo se compromete con Julia. Entonces los celos de Tessa dan un giro patológico y no se detendrá ante nada hasta convertir el sueño de Julia en su peor pesadilla." },
