    "tt4481414": { infoHash: "01866e9e4993e6732b90d7e912a8eab9485537ca", type: "movie", title: "PelicuLatino", name: "Un don excepcional", genres: ['Drama'], imdbRating: "7.7/10", releaseInfo: "2017", director: ['Marc Webb'], cast: ['Chris Evans', 'Mckenna Grace', 'Lindsay Duncan', 'Jenny Slate', 'Octavia Spencer', 'Michael Kendall Kaplan', 'John M. Jackson', 'Glenn Plummer', 'John Finn', 'Elizabeth Marvel', 'Candace B. Harris', 'Jon Sklaroff', 'Jona Xiao', 'Julie Ann Emery', 'Keir ODonnell'], description: "Frank Adler es un soltero criando a su sobrina prodigio Mary. Sus planes de que ella tenga una vida escolar normal son frustrados cuando las habilidades matemáticas de la niña llaman la atención de la madre de Frank, quien tiene planes para su nieta que amenazan con separar a Frank y Mary." },
    "tt3874544": { infoHash: "37a2475fb7d70966d58e4737b37e1fb36891a8e6", type: "movie", title: "PelicuLatino", name: "Un jefe en pañales", genres: ['Animación', 'Comedia', 'Infantil'], imdbRating: "6.4/10", releaseInfo: "2017", director: ['Tom McGrath'], cast: ['Alec Baldwin', 'Steve Buscemi', 'Jimmy Kimmel', 'Lisa Kudrow', 'Tobey Maguire', 'Miles Bakshi', 'James McGrath', 'Conrad Vernon', 'ViviAnn Yee', 'Eric Bell Jr.', 'David Soren', 'Edie Mirman', 'James Ryan', 'Walt Dohrn', 'Jules Winter'], description: "El bebé más inusual llega a la casa de Tim en un taxi, vestido de traje y cargando un maletín. La rivalidad instantánea entre hermanos debe ser puesta de lado cuando el jefe en pañales hace equipo con su hermano de siete años para detener el plan maligno del presidente de Puppy Co." },
