    "tt2962984": { infoHash: "b34f0828af8478fb65df8e580c097cce70db4cac", type: "movie", title: "PelicuLatino", name: "El día de la novia", genres: ['Comedia', 'Drama'], imdbRating: "5.3/10", releaseInfo: "2017", director: ['Michael Paul Stephenson'], cast: ['Bob Odenkirk', 'Amber Tamblyn', 'Stacy Keach', 'Alex Karpovsky', 'Kevin OGrady', 'Rich Sommer', 'Larry Fessenden', 'Natasha Lyonne', 'Andy Richter', 'June Diane Raphael', 'Stephanie Courtney', 'Echo Kellum', 'Nate Mooney', 'Radek Lord', 'Tucker Smallwood'], description: "En una ciudad donde los escritores de tarjetas son reconocidos como estrellas de cine, Romance Ray solía ser el rey. Al intentar recapturar los sentimientos que lo hicieron el mejor, se ve enredado con asesinatos y engaños mientras los escritores buscan crear la tarjeta perfecta para un nuevo día: El día de la novia." },
