    "tt3967856": { infoHash: "e93ceb43004d765f72f1cb0407bb61146c1185b4", type: "movie", title: "PelicuLatino", name: "Okja", genres: ['Acción', 'Aventura', 'Drama'], imdbRating: "7.7/10", releaseInfo: "2017", director: ['Joon-ho Bong'], cast: ['Tilda Swinton', 'Sheena Kamal', 'Michael Mitton', 'Colm Hill', 'Kathryn Kirkpatrick', 'Jose Carias', 'Giancarlo Esposito', 'Jake Gyllenhaal', 'Nancy Amelia Bell', 'Seo-Hyun Ahn', 'Jungeun Lee', 'Hee-Bong Byun', 'Jaein Kim', 'Je-mun Yun', 'Shirley Henderson'], description: "Durante diez años la joven Mija ha cuidado de un gigantesco animal llamado Okja. Pero ahora debe arriesgar todo para evitar que una poderosa compañía multinacional, la Corporación Mirando, se lleve a su mejor amigo." },
    "tt4630562": { infoHash: "21d96896cc53ecf140e3abc0e2c5cb17904c5bc7", type: "movie", title: "PelicuLatino", name: "Rápidos y furiosos 8", genres: ['Acción', 'Aventura', 'Crimen'], imdbRating: "7.0/10", releaseInfo: "2017", director: ['F. Gary Gray'], cast: ['Vin Diesel', 'Jason Statham', 'Dwayne Johnson', 'Michelle Rodriguez', 'Tyrese Gibson', 'Ludacris', 'Charlize Theron', 'Kurt Russell', 'Nathalie Emmanuel', 'Luke Evans', 'Elsa Pataky', 'Kristofer Hivju', 'Scott Eastwood', 'Patrick St. Esprit', 'Janmarco Santiago'], description: "Cuando Dom y Letty están de luna de miel en Cuba, una misteriosa mujer logra que Dom traicione a aquellos más cercanos a él y se convierta en terrorista. Ahora todo el equipo debe juntarse de nuevo para enfrentar al hombre que los hizo una familia.Serie Rápido y Furioso" },
    "tt2398241": { infoHash: "5d931e38ad0eb15501282bb43c13e1f2546f1bcb", type: "movie", title: "PelicuLatino", name: "Los Pitufos en la Aldea Perdida", genres: ['Animación', 'Aventura', 'Comedia'], imdbRating: "5.8/10", releaseInfo: "2017", director: ['Kelly Asbury'], cast: ['Demi Lovato', 'Rainn Wilson', 'Joe Manganiello', 'Jack McBrayer', 'Danny Pudi', 'Mandy Patinkin', 'Dee Bradley Baker', 'Frank Welker', 'Michelle Rodriguez', 'Ellie Kemper', 'Julia Roberts', 'Ariel Winter', 'Meghan Trainor', 'Bret Marnell', 'Brandon Jeffords'], description: "Un misterioso mapa guía a Pitufina y sus amigos Filósofo, Tontín y Fortachón en una emocionante aventura a través del Bosque Prohibido, lo cual los lleva al descubrimiento del más grande secreto en la historia de los pitufos." },
