    "tt2763304": { infoHash: "2150f6e377d2800688bb3d556514dc30f5487baf", type: "movie", title: "PelicuLatino", name: "T2 Trainspotting: La vida en el abismo", genres: ['Drama'], imdbRating: "7.4/10", releaseInfo: "2017", director: ['Danny Boyle'], cast: ['Ewan McGregor', 'Logan Gillies', 'Ben Skelton', 'Aiden Haggarty', 'Daniel Smith', 'Elijah Wolf', 'Robert Carlyle', 'Steven Robertson', 'Ewen Bremner', 'John Kazek', 'Shirley Henderson', 'Charlie Hardie', 'Scott Aitken', 'Gordon Kennedy', 'Jonny Lee Miller'], description: "Después de 20 años en el extranjero, Mark Renton regresa a Escocia y se reúne con sus viejos amigos Sick Boy, Spud y Begbie. Pero otros amigos también lo esperan: tristeza, alegría, venganza, odio, amor, miedo, arrepentimiento y peligro.Trainspotting 1 (1996)" },
    "tt3215826": { infoHash: "e3836ab7e24639e9f21613435da5c3433fa94f93", type: "movie", title: "PelicuLatino", name: "Amor rebelde", genres: ['Drama', 'Romance'], imdbRating: "5.0/10", releaseInfo: "2016", director: ['Chris Foggin'], cast: ['Will Poulter', 'Alma Jodorowsky', 'Sebastian De Souza', 'Preston Thompson', 'Cara Delevingne', 'Gala Gordon', 'Jamie Blackley', 'Pip Torrens', 'Geraldine Somerville', 'Jack Fox', 'Akash Heer', 'Alexander Pelling-Bruce', 'Aki Omoshaybi', 'Daisy Hughes', 'Genevieve Gaunt'], description: "A la deriva durante su año sabático con pasantías y planes de viaje, Jack siempre sospechó que hay más en la vida que esto. Un encuentro casual con la hermosa y etérea Evelyn y sus amigos, incluída Viola de espíritu libre, lleva a su vida radicalmente fuera de curso." },
