    "tt3878542": { infoHash: "3c3bc00acb85f0065525cb2ba0b00de281aa5d0e", type: "movie", title: "PelicuLatino", name: "Liga de la Justicia: El trono de Atlantis", genres: ['Animación', 'Acción', 'Aventura'], imdbRating: "6.7/10", releaseInfo: "2015", director: ['Ethan Spaulding'], cast: ['Sean Astin', 'Rosario Dawson', 'Nathan Fillion', 'Christopher Gorham', 'Matt Lanter', 'Sumalee Montano', 'Shemar Moore', 'Jerry OConnell', 'Jason OMara', 'Sam Witwer', 'Melique Berger', 'Steve Blum', 'Patrick Cavanaugh', 'Larry Cedar', 'Barry Dennen'], description: "Cuando tropas atlantes asaltan Metrópolis como venganza por la muerte de su rey, la reina busca ayuda de la Liga de la Justicia para encontrar a su hijo que fue perdido durante el caos." },
