    "tt1293847": { infoHash: "8da25cf92c8ccd2f122e90a640b234309a8493c9", type: "movie", title: "PelicuLatino", name: "xXx: Reactivado", genres: ['Acción', 'Aventura', 'Suspenso'], imdbRating: "5.3/10", releaseInfo: "2017", director: ['D.J. Caruso'], cast: ['Vin Diesel', 'Donnie Yen', 'Deepika Padukone', 'Kris Wu', 'Ruby Rose', 'Tony Jaa', 'Nina Dobrev', 'Rory McCann', 'Toni Collette', 'Samuel L. Jackson', 'Ice Cube', 'Hermione Corfield', 'Tony Gonzalez', 'Michael Bisping', 'Al Sapienza'], description: "El atleta extremo y ex operativo del gobierno Xander Cage es dado por muerto después de un incidente, pero ahora regresa secretamente a la acción para una nueva tarea con su contacto en la agencia.xXx (2002) - xXx 2 (2005)" },
    "tt4939066": { infoHash: "f4639824089ae558397ea48d900091a9b4bc326b", type: "movie", title: "PelicuLatino", name: "Operación Oculta", genres: ['Acción', 'Drama'], imdbRating: "6.2/10", releaseInfo: "2016", director: ['John H. Lee'], cast: ['Jung-jae Lee', 'Liam Neeson', 'Beom-su Lee', 'Mathew Darcy', 'Sean Dulake', 'Jun-ho Jeong', 'Se-Yeon Jin', 'Justin Rupple'], description: "Ocho héroes de guerra coreanos luchan en la crucial Batalla de Incheon, que sucedió en 1950, un tiempo después del comienzo de la Guerra de Corea." },
    "tt4991512": { infoHash: "e718f2b046a939b0af1ce05c7f08f3be43ef04b9", type: "movie", title: "PelicuLatino", name: "Tramps", genres: ['Comedia', 'Romance'], imdbRating: "6.6/10", releaseInfo: "2016", director: ['Adam Leon'], cast: ['Callum Turner', 'Grace Van Patten', 'Michal Vondel', 'Mike Birbiglia', 'Margaret Colin', 'Louis Cancelmi', 'Rachel Zeiger-Haag', 'Dane Martinez', 'Jeszenia Jimenez', 'Tarina Milo', 'Jamund Washington', 'Caesar Barajas', 'Miguel Cervantes', 'Elleen Hannah', 'Ty Hickson'], description: "Dos jóvenes que no se conocen, Danny y Ellie, deben pasar una noche juntos después de que un negocio, de honestidad dudosa, saliera mal." },
    "tt2261287": { infoHash: "9aeee35e06142eedfed2f36fa2e7ef7e553d5942", type: "movie", title: "PelicuLatino", name: "Bailarina", genres: ['Animación', 'Aventura', 'Comedia'], imdbRating: "6.8/10", releaseInfo: "2016", director: ['Eric Summer'], cast: ['Elle Fanning', 'Dane DeHaan', 'Carly Rae Jepsen', 'Maddie Ziegler', 'Terrence Scammell', 'Tamir Kapelian', 'Julie Khaner', 'Joe Sheridan', 'Elana Dunkelman', 'Shoshana Sperling', 'Jamie Watson', 'Bronwen Mantel', 'Mel Brooks', 'Nat Wolff'], description: "Una niña huérfana sueña con convertirse en una bailarina y huye de su pueblo rural para ir a París, donde pasa por alguien más y consigue una posición de alumna en la Grand Opera House." },
    "tt4465564": { infoHash: "74f5030618fabe0a9ff237669bc6e5237e7c5d20", type: "movie", title: "PelicuLatino", name: "Cincuenta sombras más oscuras", genres: ['Drama', 'Romance'], imdbRating: "4.7/10", releaseInfo: "2017", director: ['James Foley'], cast: ['Dakota Johnson', 'Jamie Dornan', 'Eric Johnson', 'Eloise Mumford', 'Bella Heathcote', 'Rita Ora', 'Luke Grimes', 'Victor Rasuk', 'Max Martini', 'Bruce Altman', 'Kim Basinger', 'Marcia Gay Harden', 'Andrew Airlie', 'Robinne Lee', 'Amy Price-Francis'], description: "Christian y Anastasia deciden intentarlo de nuevo, pero el pasado de Christian atormenta a Ana mientras él lucha con sus demonios internos. Adaptación de la novela del mismo nombre de E. L. James.Trilogía Cincuenta Sombras de Grey" },
    "tt2592614": { infoHash: "ec9310fcb85b8e4b30cc206761f239025956b1ad", type: "movie", title: "PelicuLatino", name: "Resident Evil: Capítulo final", genres: ['Acción', 'Terror', 'Ciencia ficción'], imdbRating: "5.6/10", releaseInfo: "2016", director: ['Paul W.S. Anderson'], cast: ['Milla Jovovich', 'Iain Glen', 'Ali Larter', 'Shawn Roberts', 'Eoin Macken', 'Fraser James', 'Ruby Rose', 'William Levy', 'Rola', 'Ever Anderson', 'Mark Simpson', 'Milton Schorr', 'Siobhan Hodgson', 'Joon-Gi Lee', 'Aubrey Shelton'], description: "Alice regresa al lugar donde comenzó la pesadilla: La Colmena en Raccoon City, donde la Corporación Umbrella está reuniendo fuerzas para un último ataque contra los últimos sobrevivientes del apocalipsis.Resident Evil 1 - Resident Evil 2: Apocalipsis - Resident Evil 3: Extinción - Resident evil 4: Resurrección - Resident Evil 5: VenganzaAnimadas: Resident Evil: Degeneración - Resident Evil: Infierno" },
    "tt5893332": { infoHash: "825930f44b94801e63f7e9f3899591eaa813a929", type: "movie", title: "PelicuLatino", name: "Sandy Wexler", genres: ['Comedia'], imdbRating: "5.1/10", releaseInfo: "2017", director: ['Steven Brill'], cast: ['Adam Sandler', 'Jennifer Hudson', 'Kevin James', 'Colin Quinn', 'Nick Swardson', 'Jackie Sandler', 'Terry Crews', 'Rob Schneider', 'Lamorne Morris', 'Aaron Neville', 'Jane Seymour', 'Sandy Wernick', 'Luis Guzmán', 'Sadie Sandler', 'Sunny Sandler'], description: "Sandy Wexler es un manager de talentos en Los Angeles en los años 90, que representa a un grupo de excéntricos clientes. Su devoción es puesta a prueba cuando se enamora de su más reciente cliente, Courtney Clark, una excepcional cantante que descubrió en un parque de diversiones." },
