    "tt2671706": { infoHash: "e447dccad34b1b743f0a947e7db9d9bb180549aa", type: "movie", title: "PelicuLatino", name: "Barreras", genres: ['Drama'], imdbRating: "7.4/10", releaseInfo: "2016", director: ['Denzel Washington'], cast: ['Denzel Washington', 'Viola Davis', 'Stephen Henderson', 'Jovan Adepo', 'Russell Hornsby', 'Mykelti Williamson', 'Saniyya Sidney', 'Christopher Mele', 'Lesley Boone', 'Jason Silvis'], description: "Troy una vez soñó con ser jugador profesional de béisbol, pero fue considerado muy viejo cuando las ligas mayores comenzaron a aceptar atletas de raza negra. Amargado por su oportunidad perdida, crea más tensión en su familia porque su hijo tiene una gran oportunidad con el fútbol americano." },
