    "tt4682786": { infoHash: "4e965ed03dec43f53c1a06b7c5c84e59d76fc7b0", type: "movie", title: "PelicuLatino", name: "Belleza inesperada", genres: ['Drama', 'Romance'], imdbRating: "6.6/10", releaseInfo: "2016", director: ['David Frankel'], cast: ['Will Smith', 'Edward Norton', 'Kate Winslet', 'Michael Peña', 'Helen Mirren', 'Naomie Harris', 'Keira Knightley', 'Jacob Latimore', 'Ann Dowd', 'Liza Colón-Zayas', 'Natalie Gold', 'Kylie Rogers', 'Shirley Rumierk', 'Alyssa Cheatham', 'Benjamin Snyder'], description: "Apartándose de la vida luego de una tragedia, un hombre cuestiona al universo escribiéndole al Amor, al Tiempo y a la Muerte. Al recibir inesperadas respuestas, comienza a ver cómo estas cosas están entrelazadas y cómo incluso la pérdida puede revelar momentos de significado y belleza." },
    "tt2667380": { infoHash: "2485b56eaa565c01eee9203d85ce52c01ccc36e9", type: "movie", title: "PelicuLatino", name: "Comando Kill", genres: ['Acción', 'Terror', 'Ciencia ficción'], imdbRating: "5.7/10", releaseInfo: "2016", director: ['Steven Gomez'], cast: ['Vanessa Kirby', 'David Ajala', 'Mike Noble', 'Bentley Kalu', 'Tom McKay', 'Kelly Gough', 'Osi Okerafor', 'Damian Kell', 'Tim Ahern', 'Deborah Rosan', 'Thure Lindhardt'], description: "En un futuro cercano, la sociedad está creando máquinas asesinas. Un grupo élite del ejército es llevado a una isla aislada para probar la capacidad de los últimos prototipos. Pero las cosas salen mal y ahora los marines deben luchar para sobrevivir en una isla llena de una inteligencia enemiga mucho mejor que sus predecesoras." },
