    "tt4303340": { infoHash: "0cdcc0f5dff392a19491e5cc54550214b3dbbe70", type: "movie", title: "PelicuLatino", name: "No soy un asesino en serie", genres: ['Drama', 'Terror', 'Suspenso'], imdbRating: "6.2/10", releaseInfo: "2016", director: ['Billy OBrien'], cast: ['Christopher Lloyd', 'Laura Fraser', 'Max Records', 'Karl Geary', 'Morgan Rysso', 'Bruce Bohne', 'Tony Papenfuss', 'Matt Roy', 'Molly Gearen', 'Lucy Lawton', 'Emmylou Barden', 'Christina Baldwin', 'Raymond Brandstrom', 'Elizabeth Belfiori', 'Anna Sundberg'], description: "En un pequeño pueblo, un adolescente con problemas y tendencias homicidas debe cazar y destruir a un asesino sobrenatural mientras mantiene a sus propios demonios a distancia." },
