    "tt3393786": { infoHash: "291f12ee7c29ae64de3c5d61f326481653f5da52", type: "movie", title: "PelicuLatino", name: "Jack Reacher: Sin regreso", genres: ['Acción', 'Aventura', 'Crimen'], imdbRating: "6.2/10", releaseInfo: "2016", director: ['Edward Zwick'], cast: ['Tom Cruise', 'Cobie Smulders', 'Aldis Hodge', 'Danika Yarosh', 'Patrick Heusinger', 'Holt McCallany', 'Judd Lormand', 'Christopher Berry', 'Hunter Burke', 'Jason Douglas', 'Lizeth Hutchings', 'Marisela Zumbado', 'Alexandra Lucchesi', 'Madalyn Horcher', 'Robert Catrini'], description: "Jack Reacher debe descubrir la verdad por detrás de una gran conspiración del gobierno para limpiar su nombre. Como fugitivo de la ley, Reacher descubre un potencial secreto de su pasado que podría cambiar su vida para siempre.Jack Reacher: Bajo la mira (2012)" },
    "tt5740806": { infoHash: "eea0ab16b9fa35ea8046ecb3f8f125e7da972f6d", type: "movie", title: "PelicuLatino", name: "A golpe de monedas", genres: ['Crimen', 'Drama', 'Familiar'], imdbRating: "4.8/10", releaseInfo: "2017", director: ['Emily Hagins'], cast: ['Blanche Baker', 'Peter Benson', 'Olivia Birkelund', 'Mark Blum', 'Elijah Boothe', 'Zach Broussard', 'Michael Cyril Creighton', 'Muhammad Cunningham', 'Will Denton', 'David Fierro', 'Joseph Harrell', 'Amy Hohn', 'Slate Holmgren', 'Mylinda Hull', 'Sage Kirwan'], description: "Unidos por desesperadas circunstancias, cuatro jóvenes de una escuela forman una alianza: el hacker, el vago, el atleta y el estudiante perfecto. Juntos intentarán hacer lo imposible: robar de la casa de moneda de Estados Unidos." },
    "tt5577742": { infoHash: "a6230cfdbd134dbda84f4fb0e6d9f19dc644d3c3", type: "movie", title: "PelicuLatino", name: "Clinical", genres: ['Suspenso'], imdbRating: "5.2/10", releaseInfo: "2017", director: ['Alistair Legrand'], cast: ['Vinessa Shaw', 'Kevin Rahm', 'India Eisley', 'Aaron Stanford', 'Nestor Serrano', 'Wilmer Calderon', 'Sydney Tamiia Poitier', 'William Atherton', 'Dion Basco', 'Adrian Flowers'], description: "Una psiquiatra intenta recomponer su vida después de un violento ataque y está buscando mejorar la vida de un nuevo paciente, pero este tiene su propia y aterradora historia." },
