    "tt5493706": { infoHash: "45e03b051ce597f53f86fe884664d8dca5cea910", type: "movie", title: "PelicuLatino", name: "Death Race 2050", genres: ['Acción', 'Comedia', 'Ciencia ficción'], imdbRating: "3.2/10", releaseInfo: "2017", director: ['G.J. Echternkamp'], cast: ['Manu Bennett', 'Malcolm McDowell', 'Marci Miller', 'Burt Grinstead', 'Folake Olowofoyeku', 'Anessa Ramsey', 'Yancy Butler', 'Charlie Farrell', 'Shanna Olson', 'D.C. Douglas', 'Sebastian Llosa', 'Emilio Montero', 'Gonzalo Alonso Ruiz'], description: "En el año 2050 el planeta está sobrepoblado y para controlar esto el gobierno crea una carrera: la carrera de la muerte. Anualmente los competidores corren a través de Estados Unidos ganando puntos por matar gente con sus vehículos." },
    "tt4701660": { infoHash: "fd9fe85561dd5589a676fb6f5c0d6fa85f9cb0ee", type: "movie", title: "PelicuLatino", name: "La Sirena", genres: ['Comedia', 'Drama', 'Fantasía'], imdbRating: "6.3/10", releaseInfo: "2016", director: ['Stephen Chow'], cast: ['Chao Deng', 'Show Lo', 'Yuqi Zhang', 'Yun Lin', 'Hark Tsui', 'Zhang Wen', 'Kris Wu', 'Sheung-ching Lee', 'Zhengyu Lu', 'Chi Ling Chiu', 'Meie Zhang', 'Linah Matsuoka', 'Barbie Liu', 'Zhen Zhen Xu', 'Bai-Ke'], description: "Shan, una sirena, es enviada para asesinar a Xuan, un desarrollador de bienes raíces que está amenazando el ecosistema de su especie, pero termina enamorándose de él." },
    "tt4361050": { infoHash: "3f24d890eee41c7d34a605baeaba259e42f6b06b", type: "movie", title: "PelicuLatino", name: "Ouija: El origen del mal", genres: ['Terror', 'Suspenso'], imdbRating: "6.2/10", releaseInfo: "2016", director: ['Mike Flanagan'], cast: ['Annalise Basso', 'Elizabeth Reaser', 'Lulu Wilson', 'Henry Thomas', 'Parker Mack', 'Halle Charlton', 'Alexis G. Zall', 'Doug Jones', 'Kate Siegel', 'Sam Anderson', 'Chelsea Gonzalez', 'Lincoln Melcher', 'Nicholas Keenan', 'Michael Weaver', 'Ele Keats'], description: "En 1967 en Los Angeles, una madre viuda y sus dos hijas añaden un nuevo truco para reforzar su negocio de falsas sesiones espiritistas, sin saber que invitaron una presencia maligna a su casa." },
