    "tt3631112": { infoHash: "49cdb6c16139b7d4846327f02759edd8c774d54a", type: "movie", title: "PelicuLatino", name: "La chica del tren", genres: ['Drama', 'Misterio', 'Suspenso'], imdbRating: "6.6/10", releaseInfo: "2016", director: ['Tate Taylor'], cast: ['Emily Blunt', 'Haley Bennett', 'Rebecca Ferguson', 'Justin Theroux', 'Luke Evans', 'Edgar Ramírez', 'Laura Prepon', 'Allison Janney', 'Darren Goldstein', 'Lisa Kudrow', 'Cleta Elaine Ellington', 'Lana Young', 'Rachel Christopher', 'Fernando Medina', 'Gregory Morley'], description: "Una mujer divorciada pasa todos los días en tren por su antigua casa. Y pronto se ve enredada en la investigación de una persona desaparecida la cual tendrá fuertes repercusiones en toda su vida." },
