    "tt4383594": { infoHash: "073ca929e1d007494d2c343d31fa5260177210b0", type: "movie", title: "PelicuLatino", name: "Mi papá es un gato", genres: ['Comedia', 'Infantil', 'Fantasía'], imdbRating: "5.2/10", releaseInfo: "2016", director: ['Barry Sonnenfeld'], cast: ['Kevin Spacey', 'Jennifer Garner', 'Robbie Amell', 'Cheryl Hines', 'Mark Consuelos', 'Malina Weissman', 'Christopher Walken', 'Talitha Bateman', 'Teddy Sears', 'Jay Patterson', 'Jewelle Blackman', 'Serge Houde', 'Mark Camacho', 'Chris Wilding', 'Kyle Gatehouse'], description: "Cuando un hombre de negocios va en busca de un gato para su hija recibe más de lo que esperaba: él mismo termina convirtiéndose en el gato. Tal vez así pueda restaurar su relación con su hija y su familia ya que siempre anda ocupado." },
